import logo from './logo.svg';
import './App.css';

function Login() {
  return (
    <>
      <form method='POST' className="login">
        <input placeholder='User Name' required></input>
        <input placeholder='Password' type="password" required></input>
      </form>
    <button>Login</button>
    </>
  );
}

export default Login;
